import logo from './logo.svg';
import './App.css';

function App() {

  var squares=["one", "two"]
  function Text(props, name=null){

    return(

      <div> <p> Text the name is {props.name} that's all age is {props.age}</p></div>)
  }

  function RenderComponent() {
  const products = ['orange', 'apple', 'watermelon'];

  const list = products.map(product => <li key={product}>{product}</li>)

  return (
    <div>
      {list}
    </div>
  )
}
  function RenderSquares() {
  const squares = [1, 2, 3];

  const list = squares.map(square => <li>{square}</li>)

  return (
    <div>
      {list}
    </div>
  )
}
class Square extends React.Component {
  render() {
    return (
      <button className="square">
        {this.props.value}
      </button>
    );
  }
}
 function renderSquare(i){
    return <Square value={i}/>
  }



  return (
    <div className="App">
     <h1> Test </h1>
     <Text name={"John"}/>
     <Text age={41} />
     <RenderComponent />
     <RenderSquares />
     <Square/>
     <Square/>

     {renderSquare(1)}

    </div>
  );
}

export default App;
